// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721Receiver.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

contract CubifoxMarket is Ownable, IERC721Receiver {
    using Counters for Counters.Counter;
    Counters.Counter public tradeIdCounter;

    event TradeOpen(
        uint256 tradeId,
        address itemToken,
        uint256 itemTokenId,
        address currencyToken,
        uint256 price,
        address poster
    ); // price is 1 / 1000000000000000000 MATIC
    event TradeStatusChange(uint256 tradeId, bytes32 status);

    IERC20 _currencyToken; // "0x0000000000000000000000000000000000001010"
    IERC721 _itemToken; // "0x9967a309fce3De66A70704431338a3d086509732"

    struct Trade {
        address poster;
        uint256 item;
        uint256 price;
        TRADE_STATE status;
    }

    mapping(uint256 => Trade) public trades;

    enum TRADE_STATE {
        OPEN,
        ECECUTED,
        CANCELED
    }

    constructor(address _currencyTokenAddress, address _itemTokenAddress)
        IERC721Receiver()
    {
        _currencyToken = IERC20(_currencyTokenAddress);
        _itemToken = IERC721(_itemTokenAddress);
    }

    function onERC721Received(
        address operator,
        address from,
        uint256 tokenId,
        bytes calldata data
    ) external override returns (bytes4) {
        return IERC721Receiver.onERC721Received.selector;
    }

    function openTrade(uint256 _itemId, uint256 _price) external {
        // TODO: Openなトレードの中に同じ_itemIdがないかチェックする
        uint256 tradeId = tradeIdCounter.current();
        require(
            _itemToken.ownerOf(_itemId) == msg.sender,
            "You don't own this item."
        );

        _itemToken.safeTransferFrom(msg.sender, address(this), _itemId);

        trades[tradeId] = Trade({
            poster: msg.sender,
            item: _itemId,
            price: _price,
            status: TRADE_STATE.OPEN
        });

        tradeIdCounter.increment();
        emit TradeOpen(
            tradeId,
            address(_itemToken),
            _itemId,
            address(_currencyToken),
            _price,
            msg.sender
        );
    }

    function executeTrade(uint256 _tradeId) external payable {
        Trade storage trade = trades[_tradeId];
        require(trade.status == TRADE_STATE.OPEN, "Trade is not Open.");
        require(msg.sender != trade.poster, "You cannot purchase it yourself.");
        require(msg.value >= trade.price, "Insufficient payment");

        _currencyToken.transfer(trade.poster, trade.price);
        _itemToken.transferFrom(address(this), msg.sender, trade.item);

        trade.status = TRADE_STATE.ECECUTED;
        emit TradeStatusChange(_tradeId, "Executed");
    }

    function cancelTrade(uint256 _tradeId) public {
        Trade storage trade = trades[_tradeId];
        require(trade.status == TRADE_STATE.OPEN, "Trade is not Open.");
        require(
            msg.sender == trade.poster,
            "Trade can be cancelled only by poster."
        );

        _itemToken.transferFrom(address(this), trade.poster, trade.item);
        trade.status = TRADE_STATE.CANCELED;
        emit TradeStatusChange(_tradeId, "Canceled");
    }
}
